import React from 'react'

const EmptyCart=(props)=>{
    return (
        <div className="container mt-5">
            <div className="row">
                <div className="col-10 mx-auto text-center text-title">
                    <h1>Your cart is currently empty</h1>
                </div>
            </div>
        </div>
    );
}

export default EmptyCart;
